import axioswithoutjwt from 'axios'

axioswithoutjwt.defaults.baseURL = 'http://localhost:8090/api/v1'

axioswithoutjwt.interceptors.request.use(config => {
	config.headers['Content-Type'] = 'application/json; charset=utf-8';
	return config
})

export default axioswithoutjwt
